import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { BibliotecaComponent } from './pantallas/biblioteca/biblioteca.component';
import { BotonGeneralComponent } from './componentes/boton-general/boton-general.component';
import { BotonRecetaComponent } from './componentes/boton-receta/boton-receta.component';
import { RecetaComponent } from './pantallas/receta/receta.component';

@NgModule({
  declarations: [
    AppComponent,
    BibliotecaComponent,
    BotonGeneralComponent,
    BotonRecetaComponent,
    RecetaComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
